import './App.scss';
import Header from './components/Header';
import ListUsers from './components/ListUsers';
import ModalAddUsers from './components/ModalAddUsers';
import TableUsers from './components/TableUsers';

function App() {
  return (
    <div className='app-container'>
        <Header />
        <ListUsers />
        <TableUsers />
        <ModalAddUsers />
    </div>
  );
}

export default App;
